<template>
	<view>
		<uni-swipe-action >
			<uni-swipe-action-item v-for="(item,index) in list" :right-options="options"
				:auto-close="false" @click="bindClick(index)">
				
				<view class="content-box" >
					<uni-list-chat :avatar-circle="true" :title="item.info.transferName ||item.info.name " :avatar="item.info.url||'/static/paySe.png'"
						:note="isTransfer(item.type)" :clickable="true" @click="goPage(item)"></uni-list-chat>
				</view>
			</uni-swipe-action-item>
			
		</uni-swipe-action>
	</view>
</template>

<script>
	export default {
		data() {
			return {
				options: [{
						text: '删除',
						style: {
							backgroundColor: '#F56C6C'
						}
					}
				
				],
				list:[
					{
					    "type": 0,
					    "info": {
					        "url": "data:image/jpeg;base64,",
					        "time": "2025年6月3日 21:23:40",
					        "orderNumber": "1000050001202506030822269810799",
					        "otherTime": "2025年6月3日 21:42:26",
					        "transferName": "转给莴笋批发223档口",
					        "num": "88.00"
					    }
					},
					{
					    "type": 0,
					    "info": {
					        "url": "data:image/jpeg;base64,",
					        "time": "2025年6月3日 21:23:40",
					        "orderNumber": "1000050001202506030822269810799",
					        "otherTime": "2025年6月3日 21:42:26",
					        "transferName": "转给莴笋批发223档口",
					        "num": "88.00"
					    }
					}
				]
			}
		},
		onLoad(){
		  this.list= uni.getStorageSync('tfList') || []
		  console.log(this.list);
		},
		methods: {
			bindClick(index){
				this.list.splice(index,1)
				 uni.setStorageSync('tfList', this.list);
			},
			isTransfer(index) {
			    switch(index) {
			        case 0: return '转账';
			        case 1: return '扫码';
			        case 2: return '第三方';
			        case 3: return '小程序付款';
			        case 4: return '条形码（16位）';
			        case 5: return '条形码（32位）';
			        default: return '付款'; // 保持原有默认逻辑
			    }
			},
			goPage(item) {
			    const { type, info } = item;
			    
			    // 路由映射配置，便于后续维护和扩展
			    const routeMap = {
			        0: '/pages/transfer/transfer',
			        1: '/pages/codePayChild/codePayChild',
			        2: '/pages/ThirdpartyPayment/ThirdpartyPayment',
			        3: '/pages/miniThirdpartyPayment/miniThirdpartyPayment',
			        4: '/pages/barcodeThirdpartyPayment/barcodeThirdpartyPayment',
			        5: '/pages/barcodeThirdpartyPayment32/barcodeThirdpartyPayment32'
			    };
			
			    // 获取目标路由，不存在则使用默认值
			    const targetRoute = routeMap[type] || '/pages/defaultPayment/defaultPayment';
			    
			    // 构建完整URL
			    const url = `${targetRoute}?info=${encodeURIComponent(JSON.stringify(info))}`;
			    
			    // 导航到目标页面
			    uni.navigateTo({ url });
			}
		}
	}
</script>

